import React,{Component}from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import '../components/Home.css'

export default class ArcitectPage extends Component{
    constructor(props){
        super(props);
        
        this.state={Requests:[]};
    }
    componentDidMount(){
      //${this.props.userID}
        axios.get(`http://localhost:3000/Request/Userid/${this.props.User._id}`)
        .then(res=>{console.log(res.data)
         this.setState({Requests:res.data.Req})})
        .catch(err=>{console.log('Error'+err)})
    }

    RequestsList(){
        return this.state.Requests.map( currentRequests=>{
            return(
            <tr key={currentRequests._id}>
            <td>{currentRequests._id}</td>
            <td>{currentRequests.type}</td>
            {currentRequests.status==="Accepted"?<td className="text-success">{currentRequests.status}</td>
            :<>{currentRequests.status==="Decline"?<td className="text-danger">{currentRequests.status}</td>
            :<td className="text-warning">{currentRequests.status}</td>}</>}
            </tr>
            )})
    }
    render(){
        return(
        <>
        <nav className="navbar navbar-light sticky-top " style={{backgroundColor:"#e3f2fd"}}>

        </nav>
        <div className="container-fluid">
            
            
            <div className="row">
            <div id="sidebar-wrapper" className="col-md-1 col-lg-2  ">
                <div className="list-group text-center ml-3 ">
                <Link to={{pathname:"/RequsetAggre" ,aboutProps:{User:this.props.User}}} className="mt-5 list-group-item list-group-item-action">Aggregate Request</Link>
                <Link to={{pathname:"/RequsetSvm" ,aboutProps:{User:this.props.User}}} className="list-group-item list-group-item-action">Svm Request </Link>
                <Link to={{pathname:"/RequestVolume" ,aboutProps:{User:this.props.User}}} className="list-group-item list-group-item-action">Volume Request</Link>
                <Link to={{pathname:"/Bug" ,aboutProps:{User:this.props.User}}} className="list-group-item list-group-item-action">
                    <svg width="1em" height="1em" viewBox="0 0 16 16" className="bi bi-bug" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
                    <path fillRule="evenodd" d="M4.355.522a.5.5 0 0 1 .623.333l.291.956A4.979 4.979 0 0 1 8 1c1.007 0 1.946.298 2.731.811l.29-.956a.5.5 0 1 1 .957.29l-.41 1.352A4.985 4.985 0 0 1 13 6h.5a.5.5 0 0 0 .5-.5V5a.5.5 0 0 1 1 0v.5A1.5 1.5 0 0 1 13.5 7H13v1h1.5a.5.5 0 0 1 0 1H13v1h.5a1.5 1.5 0 0 1 1.5 1.5v.5a.5.5 0 1 1-1 0v-.5a.5.5 0 0 0-.5-.5H13a5 5 0 0 1-10 0h-.5a.5.5 0 0 0-.5.5v.5a.5.5 0 1 1-1 0v-.5A1.5 1.5 0 0 1 2.5 10H3V9H1.5a.5.5 0 0 1 0-1H3V7h-.5A1.5 1.5 0 0 1 1 5.5V5a.5.5 0 0 1 1 0v.5a.5.5 0 0 0 .5.5H3c0-1.364.547-2.601 1.432-3.503l-.41-1.352a.5.5 0 0 1 .333-.623zM4 7v4a4 4 0 0 0 3.5 3.97V7H4zm4.5 0v7.97A4 4 0 0 0 12 11V7H8.5zM12 6H4a3.99 3.99 0 0 1 1.333-2.982A3.983 3.983 0 0 1 8 2c1.025 0 1.959.385 2.666 1.018A3.989 3.989 0 0 1 12 6z"/>
                    </svg>
                    {" Report Bug"}
                </Link>
                </div>
            </div>
            <div className="col-md-11 col-lg-10">
            <div className="jumbotron" >
                <div className="container">
                    <h1 className="h1">Hello {this.props.User.Nickname}</h1>
                        <p className="font-weight-bolder">This is a modified jumbotron<br/> that occupies the entire horizontal<br/> space of its parent.</p>
                        <br/><br/>
                        
                    </div>
                </div>
                <div>
                    <table className="table table-hover ">
                        <thead>
                            <tr className="table-primary">
                                <th scope="col">Request Number</th>
                                <th scope="col">type</th>
                                <th scope="col">Status</th>
                            </tr>
                        </thead>
                        <tbody className="table-striped">
                            {this.RequestsList()}
                        </tbody>
                    </table>
                </div>
            </div> 
        </div>
        </div>
        </>
        )
    }
}
